import React from "react";

function NavBar() {
  return (
    <div>
      <ul class="nav">
        <li class="nav-item">Home</li>
        <li class="nav-item">Link</li>
        <li class="nav-item">Disabled</li>
        <li class="nav-item"></li>
      </ul>
    </div>
  );
}

export default NavBar;
